<p>Съедобная игрушка лакомство для кошек &laquo;Веселый Мур-р-рмелад&raquo; со вкусом курицы<br />Вкусная и полезная игрушка для кошек:</p>
<p>способствует психологической разрядке животного (удовлетворяет инстинкт охоты);<br />очищает кишечник от фрагментов ранее съеденных игрушек, не переваренного корма и вылизанной шерсти;<br />является профилактикой развития мочекаменной болезни.<br />В состав мурмеладки входят важные для здоровья кошки элементы: таурин, мумиё, комплекс витаминов группы В (В1, Вз, В6).</p>
</body></html>

