                        <html><head><meta charset="utf-8"></head><body>
<p><strong>Назначение</strong>:<br />&laquo;ВЕСЕЛЫЙ МУР-Р-РМЕЛАД&raquo; съедобные игрушки (лакомство) для кошек представляет собой функциональный корм для непродуктивных животных, предназначенный для использования в качестве лакомства с целью поощрения и дрессуры животных. &laquo;ВЕСЕЛЫЙ МУР-Р-РМЕЛАД&raquo; съедобные игрушки (лакомство) для кошек выпускают в виде колечек, рыбок, кофейных зерен и т.д. и упаковывают штучно или общей массой от 5 г до 300 г в контейнеры, помещенные в пакеты из пленки и/или в банки полимерные. Допускаются другие виды упаковочных материалов, разрешенные для использования в установленном порядке для упаковывания лекарственных средств и пищевых продуктов.</p>
<p><strong>Особенности использования</strong>:<br />возможна индивидуальная повышенная чувствительность или непереносимость отдельных компонентов.</p>
<p>Функциональная ценность компонентов:<br />Таурин - аминосульфоновая кислота, необходимая для развития и поддержания целостности нервной ткани, способствующая восстановлению системы мембранного аппарата клеток, участвующая в механизмах свертывания крови, процессах иммунитета, защите легочной ткани. Таурин способствует процессам роста, необходим для нормального развития нервной системы, сетчатки и мышц. Таурин важен для продуцирования желчи, необходимой для нормального пищеварения и жирового обмена, улучшает действие инсулина.</p>
<p>Витаминный комплекс - комплекс, содержащий в своем составе витамины В1(тиамин), B3 (ниацин), B6 (пиридоксин). Это жизненно важные соединения, участвующие во всех клеточных процессах.</p>
<p>Мумие - в своем составе содержит около 28 химических элементов, 30 макро- и микроэлементов, а также 10 различных окисей металлов, 6 аминокислот, ряд витаминов т.ч. В12, эфирные масла, пчелиный яд, смолоподобные вещества - каждое из которых способно повлиять на соответствующие обменные процессы организма, усиливать регенеративные процессы в различных тканях. Мумие обладает противовоспалительным, антитоксическим, общеукрепляющим действием, а также восстанавливает пониженную функцию периферических нервных стволов и анализаторных центров головного мозга, положительно участвует в биосинтезе клетки ДНК, что приводит к усиленному делению и увеличению количества клеток.</p>
<p><strong>Способ применения</strong>:<br />лакомство дают животным 1-3 раза в сутки. Ограничений по длительности включения лакомства в рацион кормления не существует.</p>
<p><strong>Состав</strong>:<br />сахар-песок, вода питьевая, глюкоза, желатин пищевой, корм сухой, крахмал картофельный, глицерин, масло подсолнечное, комплекс витаминов группы В (В1, Вз, В6), таурин, кислота лимонная, сорбат калия, мумие.</p>
<p>Пищевая ценность на 100 г не менее:</p>
<p>Белки 7 г<br />Углеводы 50 г<br />Жиры 0,8г</p>
<p>Энергетическая ценность в 100 г 236 ккал.</p>
<p><strong>Условия хранения</strong>:<br />корм хранят в течение 12 месяцев в хорошо проветриваемых сухих, чистых помещениях, не имеющих постороннего запаха при температуре (15&plusmn;5)˚С при относительной влажности воздуха (80&plusmn;5) %.</p>
<p><strong>Срок годности</strong>:<br />12 месяцев с даты изготовления.</p>
</body></html>
